import  './Form.css';
const Form = () => { 
    return(
        <div className='form-container'>
            <form>
                <label>FirstName: </label>
                <input type="text"  placeholder = "Name..."></input>

                <label>Age: </label>
                <input type="number"  placeholder = "Name..."></input>

                <label>Position: </label>
                <input type="text"  placeholder = "Name..."></input>
            </form>
        </div>
    ); 
}
export default Form;
